import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container,
  TextField,
  Button,
  Grid,
  Card,
  CardContent,
  CardActions,
  Typography,
  Box,
} from '@mui/material';
import './Header.css'

const LabTest = () => {
  const [labTests, setLabTests] = useState([]);
  const [newTest, setNewTest] = useState({ testName: '', description: '', price: '' });
  const [editingTest, setEditingTest] = useState(null);

  useEffect(() => {
    fetchLabTests();
  }, []);

  const fetchLabTests = async () => {
    try {
      const response = await axios.get('http://localhost:3000/labtests');
      setLabTests(response.data.data);
    } catch (error) {
      console.error('Error fetching lab tests:', error);
    }
  };

  const createLabTest = async () => {
    try {
      const response = await axios.post('http://localhost:3000/labtests', newTest);
      setLabTests([...labTests, response.data.data]);
      setNewTest({ testName: '', description: '', price: '' });
    } catch (error) {
      console.error('Error creating lab test:', error);
    }
  };

  const updateLabTest = async (id) => {
    try {
      const response = await axios.put(`http://localhost:3000/labtests/${id}`, editingTest);
      setLabTests(labTests.map((test) => (test._id === id ? response.data.data : test)));
      setEditingTest(null);
    } catch (error) {
      console.error('Error updating lab test:', error);
    }
  };

  const deleteLabTest = async (id) => {
    try {
      await axios.delete(`http://localhost:3000/labtests/${id}`);
      setLabTests(labTests.filter((test) => test._id !== id));
    } catch (error) {
      console.error('Error deleting lab test:', error);
    }
  };

  return (
    <Container className='hihi '>
      <Typography variant="h4" gutterBottom>
        Lab Tests
      </Typography>

      {/* Add New Lab Test Form */}
      <Box mb={4}>
        <TextField
          label="Test Name"
          value={newTest.testName}
          onChange={(e) => setNewTest({ ...newTest, testName: e.target.value })}
          variant="outlined"
          margin="normal"
          fullWidth
        />
        <TextField
          label="Description"
          value={newTest.description}
          onChange={(e) => setNewTest({ ...newTest, description: e.target.value })}
          variant="outlined"
          margin="normal"
          fullWidth
        />
        <TextField
          label="Price"
          type="number"
          value={newTest.price}
          onChange={(e) => setNewTest({ ...newTest, price: e.target.value })}
          variant="outlined"
          margin="normal"
          fullWidth
        />
        <Button variant="contained" color="primary" onClick={createLabTest}>
          Add Lab Test
        </Button>
      </Box>

      {/* Display Existing Lab Tests */}
      <Grid container spacing={3}>
        {labTests.map((test) => (
          <Grid item xs={12} md={6} lg={4} key={test._id}>
            <Card>
              <CardContent>
                {editingTest && editingTest._id === test._id ? (
                  <>
                    <TextField
                      label="Test Name"
                      value={editingTest.testName}
                      onChange={(e) => setEditingTest({ ...editingTest, testName: e.target.value })}
                      variant="outlined"
                      margin="normal"
                      fullWidth
                    />
                    <TextField
                      label="Description"
                      value={editingTest.description}
                      onChange={(e) => setEditingTest({ ...editingTest, description: e.target.value })}
                      variant="outlined"
                      margin="normal"
                      fullWidth
                    />
                    <TextField
                      label="Price"
                      type="number"
                      value={editingTest.price}
                      onChange={(e) => setEditingTest({ ...editingTest, price: e.target.value })}
                      variant="outlined"
                      margin="normal"
                      fullWidth
                    />
                  </>
                ) : (
                  <>
                    <Typography variant="h6">{test.testName}</Typography>
                    <Typography variant="body2" color="textSecondary">
                      {test.description}
                    </Typography>
                    <Typography variant="body1">${test.price}</Typography>
                  </>
                )}
              </CardContent>
              <CardActions>
                {editingTest && editingTest._id === test._id ? (
                  <>
                    <Button size="small" color="primary" onClick={() => updateLabTest(test._id)}>
                      Save
                    </Button>
                    <Button size="small" color="secondary" onClick={() => setEditingTest(null)}>
                      Cancel
                    </Button>
                  </>
                ) : (
                  <>
                    <Button size="small" color="primary" onClick={() => setEditingTest(test)}>
                      Edit
                    </Button>
                    <Button size="small" color="secondary" onClick={() => deleteLabTest(test._id)}>
                      Delete
                    </Button>
                  </>
                )}
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default LabTest;
